import React from 'react'

import './progress.css'

const Progress = (props) => {

    
  return (
    <div className="tasks-container3">
        <div class="progress">
        <div class="progress-done" data-done="70"></div>  
        </div>
        <label className="tasks-text1"> 5% </label>
    </div>
  )
}

export default Progress
